import React, { useState } from 'react';
import './App.css';

function App() {
  const [currentPage, setCurrentPage] = useState('dashboard');
  const [apiStatus, setApiStatus] = React.useState<string>('Checking...');

  React.useEffect(() => {
    fetch('/api/test')
      .then(res => res.json())
      .then((data: any) => setApiStatus(data.message))
      .catch(() => setApiStatus('API connection failed'));
  }, []);

  const renderPage = () => {
    switch(currentPage) {
      case 'contractors':
        return <ContractorsPage />;
      case 'projects':
        return <ProjectsPage />;
      default:
        return (
          <div className="App">
            <header className="App-header">
              <h1>Roofing Inspection Service Platform</h1>
              <p>Professional roof inspection, estimation, and reporting services for contractors</p>

              <div style={{ 
                marginTop: '2rem', 
                padding: '1rem', 
                background: '#f0f8ff', 
                borderRadius: '8px', 
                color: '#333' 
              }}>
                <h3>Platform Status</h3>
                <p><strong>Service API:</strong> {apiStatus}</p>
                <p><strong>Payment Processing:</strong> Ready</p>
                <p><strong>Database:</strong> Connected</p>
              </div>

              <div style={{ marginTop: '2rem', display: 'flex', gap: '1rem', justifyContent: 'center' }}>
                <button 
                  onClick={() => setCurrentPage('contractors')}
                  style={{
                    background: '#2563eb',
                    color: 'white',
                    padding: '12px 24px',
                    border: 'none',
                    borderRadius: '8px',
                    cursor: 'pointer',
                    fontSize: '16px'
                  }}
                >
                  View Contractors
                </button>
                <button 
                  onClick={() => setCurrentPage('projects')}
                  style={{
                    background: '#059669',
                    color: 'white',
                    padding: '12px 24px',
                    border: 'none',
                    borderRadius: '8px',
                    cursor: 'pointer',
                    fontSize: '16px'
                  }}
                >
                  View Projects
                </button>
              </div>
            </header>
          </div>
        );
    }
  };

  return (
    <div>
      {currentPage !== 'dashboard' && (
        <nav style={{ padding: '1rem', background: '#f8f9fa', borderBottom: '1px solid #dee2e6' }}>
          <button 
            onClick={() => setCurrentPage('dashboard')}
            style={{ marginRight: '1rem', padding: '8px 16px', background: '#6c757d', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}
          >
            Dashboard
          </button>
          <button 
            onClick={() => setCurrentPage('contractors')}
            style={{ marginRight: '1rem', padding: '8px 16px', background: currentPage === 'contractors' ? '#2563eb' : '#e9ecef', color: currentPage === 'contractors' ? 'white' : 'black', border: 'none', borderRadius: '4px', cursor: 'pointer' }}
          >
            Contractors
          </button>
          <button 
            onClick={() => setCurrentPage('projects')}
            style={{ padding: '8px 16px', background: currentPage === 'projects' ? '#059669' : '#e9ecef', color: currentPage === 'projects' ? 'white' : 'black', border: 'none', borderRadius: '4px', cursor: 'pointer' }}
          >
            Projects
          </button>
        </nav>
      )}
      {renderPage()}
    </div>
  );
}

const ContractorsPage: React.FC = () => {
  const [contractors, setContractors] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);

  React.useEffect(() => {
    fetch('/api/contractors')
      .then(res => res.json())
      .then(data => {
        setContractors(data.contractors);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  if (loading) return <div className="p-8">Loading contractors...</div>;

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Contractor Management</h1>
      <div className="bg-white rounded-lg shadow overflow-hidden">
        <table className="min-w-full">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Company</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Contact</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Projects</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Revenue</th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-200">
            {contractors.map((contractor) => (
              <tr key={contractor.id}>
                <td className="px-6 py-4 whitespace-nowrap font-medium">{contractor.companyName}</td>
                <td className="px-6 py-4 whitespace-nowrap">{contractor.contactEmail}</td>
                <td className="px-6 py-4 whitespace-nowrap">{contractor.totalProjects}</td>
                <td className="px-6 py-4 whitespace-nowrap">${contractor.totalRevenue.toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const ProjectsPage: React.FC = () => {
  const [projects, setProjects] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);

  React.useEffect(() => {
    fetch('/api/projects')
      .then(res => res.json())
      .then(data => {
        setProjects(data.projects);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  if (loading) return <div className="p-8">Loading projects...</div>;

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Project Queue</h1>
      <div className="bg-white rounded-lg shadow overflow-hidden">
        <table className="min-w-full">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Contractor</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Property</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Service</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Value</th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-200">
            {projects.map((project) => (
              <tr key={project.id}>
                <td className="px-6 py-4 whitespace-nowrap">{project.contractor.companyName}</td>
                <td className="px-6 py-4 whitespace-nowrap">{project.propertyAddress}</td>
                <td className="px-6 py-4 whitespace-nowrap">{project.serviceType.replace('_', ' ')}</td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <span className={`px-2 py-1 text-xs rounded-full ${
                    project.status === 'PAID' ? 'bg-green-100 text-green-800' : 'bg-yellow-100 text-yellow-800'
                  }`}>
                    {project.status}
                  </span>
                </td>
                <td className="px-6 py-4 whitespace-nowrap">${parseFloat(project.totalCost).toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default App;
